Desde Salta, Christian Vitry (montañista, antropólogo y Director General de Gestión Patrimonial de la provincia) y Bernardo Cornejo Maltz (fotógrafo y antropólogo) presentará el proyecto arqueológico Arte Rupestre Tastil y el Programa Qhapaq Ñan

Abro Hilo es un lugar de encuentro y debate sobre temas que pegan fuerte en nuestras vidas, abordados desde la ciencia y la tecnología y su impacto social. Drogas, cambio climático, modelos de ciudad, inteligencia artificial y datos, sexualidad, salud mental y alimentos son algunos de los temas que se abordarán en las emisiones.

En el Festival Nacional de Folklore de Cosquín podés encontrar la riqueza y la diversidad de todas las culturas que conviven dentro de las fronteras de la Argentina.

@micaelachauque subió al escenario Atahualpa Yupanqui en la tercera luna de @aquicosquinok y trajo la alegría del carnaval jujeño a las tierras cordobesas.

Mirá en vivo #FestivalPaís en www.tvpublica.com.ar

Falta sólo un día para que arranque el festival más importante de música folclórica de Argentina.​​ 

